  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This file contains case level data for
  inpatient psychiatric stays and is derived from 2011 MEDPAR data file and the latest
  available provider specific file. The data available in this file are consistent
  with the data as described in the IPF PPS Update Notice published in August 2012.
  The records are stripped of most data elements that will permit identification of
  beneficiaries. This file includes approximately 0.5 million records for services
  paid under the inpatient psychiatric benefit.</p>n\",\n\t\"license_title\": \"Other
